window.bookSummaryJSON = "<p>Almost 3,000 years after an extinction-level event on Earth, mankind seeks to regain its former glory, in a new world where magic and technology collide. </p> <p>Laney Herder, a commoner in the realm of Wexbury, finds herself thrust into the world of nobles and knights. At the side of her Lady Celeste, Knight of the Realm, she goes on an epic journey from being a simple chicken farmer to one of the greatest heroes of the realm, while helping the Lands of Sparo avoid a second Great Mage War. </p> <p>Can kindness and innocence defeat the oncoming storm? </p>"; 
